import React from 'react';
import Header from '../../components/Header';

const createProductPage = () => {
    return (
        <>
            <div className="create-products-content">
                <Header />
                <main>
                    <h2 className="dash-title">All Products List</h2>
                </main>
            </div>
        </>
    )
}

export default createProductPage;
